import React from 'react'
import './ServerIcon.css'
import avatar from './images/avatar.png';

function ServerIcon({ image }) {
    return (
        <div className='serverIcon'>
            <img
                src={image}
                alt='icon'
                className='serverIcon_img'
            />
        </div>
    )
}

export default ServerIcon
